import { useLocation } from "react-router-dom";
import BotaoPrecisao from "../compontente/BotaoPrecisao/BotaoPrecisao";
import Cabecalho from "../compontente/Cabecalho/Cabecalho";
import Estante from "../compontente/Estante/Estante";
import "./TelaEstante.css";
import { useEffect, useState } from "react";
import axios from "axios";
import Livro from "../compontente/Livro/Livro";

function TelaEstante() {
  
  const location = useLocation();
  console.log(location.state.id);
 
  
  const [Estantes, setEstantes] = useState([{}]);
   
  useEffect(() => {
    axios
      .get("http://localhost:8080/map")
      .then((resposta) => {
       setEstantes(resposta.data)
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);

  console.log(Estantes)
  return (
    <>

      <Cabecalho />
      <div className="TelaEstante">
      {Estantes.map((conteudo) => {
            console.log(conteudo)
          if(conteudo != undefined){
            return (
              <Estante id={1} x={125} y={250} r={0} h={200} w={100}/>
                        );
          }
        })}
        <Estante id={1} x={125} y={250} r={0} h={150} w={100}/>
        <Estante id={2} x={250} y={250} r={0} h={150} w={100}/>
        <Estante id={3} x={125} y={75} r={0} h={150} w={100}/>
        <Estante id={4} x={250} y={75} r={0} h={150} w={100}/>
        
        <BotaoPrecisao />
      </div>
    </>
  );
}

export default TelaEstante;
